    const [neutral, setNeutral] = useState(0)
    const [bad, setBad] = useState(0)

    const titles = ['give feedback', 'statistics']

    return (
        <div>
            <Header title={titles[0]} />



            <Header title={titles[1]} />
        </div>
    )
}

